// src/components/challenges/ControlPanel.jsx
import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import {
  Paper,
  Typography,
  Box,
  Slider,
  Button,
  Grid,
  Card,
  CardContent,
  Switch,
  FormControlLabel,
  Alert,
  Chip
} from '@mui/material';
import { 
  PlayArrow, 
  Stop, 
  Home, 
  Warning,
  Speed,
  Settings
} from '@mui/icons-material';
import { moveJoint, moveToPosition, emergencyStop } from '../../store/robotSlice';

const ControlPanel = () => {
  const dispatch = useDispatch();
  const { 
    connected, 
    jointAngles, 
    loading,
    safetyStatus,
    connectionStatus 
  } = useSelector(state => state.robot);
  
  const [targetAngles, setTargetAngles] = useState([0, 0, 0]);
  const [speed, setSpeed] = useState(50);
  const [torqueEnabled, setTorqueEnabled] = useState(true);
  const [movementMode, setMovementMode] = useState('individual'); // 'individual' or 'coordinated'

  const jointLimits = [
    { min: -150, max: 150, name: 'Base' },
    { min: -90, max: 90, name: 'Shoulder' },
    { min: -90, max: 90, name: 'Elbow' }
  ];

  const handleJointChange = (jointIndex, value) => {
    const newAngles = [...targetAngles];
    newAngles[jointIndex] = value;
    setTargetAngles(newAngles);
  };

  const executeMovement = async () => {
    if (!connected) {
      alert('Robot not connected!');
      return;
    }

    try {
      if (movementMode === 'individual') {
        // Move joints individually
        for (let i = 0; i < targetAngles.length; i++) {
          await dispatch(moveJoint({ 
            jointId: i + 1, 
            angle: targetAngles[i], 
            speed 
          }));
        }
      } else {
        // Coordinated movement
        await dispatch(moveToPosition({ 
          angles: targetAngles, 
          speed 
        }));
      }
    } catch (error) {
      console.error('Movement failed:', error);
    }
  };

  const homePosition = () => {
    setTargetAngles([0, 0, 0]);
    if (connected) {
      dispatch(moveToPosition({ angles: [0, 0, 0], speed }));
    }
  };

  const stopMotion = () => {
    dispatch(emergencyStop());
  };

  const getConnectionStatusColor = () => {
    switch (connectionStatus) {
      case 'connected': return 'success';
      case 'connecting': return 'warning';
      case 'disconnected': return 'error';
      default: return 'default';
    }
  };

  return (
    <Paper sx={{ p: 3 }}>
      <Typography variant="h5" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
        <Settings />
        Robot Control Panel
      </Typography>

      {/* Connection Status */}
      <Box sx={{ mb: 3 }}>
        <Chip
          label={`Status: ${connectionStatus || 'Unknown'}`}
          color={getConnectionStatusColor()}
          sx={{ mr: 2 }}
        />
        {safetyStatus && (
          <Chip
            label={safetyStatus.safe ? 'Safe' : 'Warning'}
            color={safetyStatus.safe ? 'success' : 'error'}
            icon={safetyStatus.safe ? undefined : <Warning />}
          />
        )}
      </Box>

      {/* Safety Alert */}
      {!connected && (
        <Alert severity="warning" sx={{ mb: 3 }}>
          Robot not connected. Controls will not affect actual hardware.
        </Alert>
      )}

      <Grid container spacing={3}>
        {/* Joint Controls */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Joint Position Control
              </Typography>
              
              {jointLimits.map((joint, index) => (
                <Box key={index} sx={{ mb: 3 }}>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                    <Typography variant="body2">
                      Joint {index + 1} ({joint.name})
                    </Typography>
                    <Box sx={{ display: 'flex', gap: 2 }}>
                      <Typography variant="body2" color="text.secondary">
                        Target: {targetAngles[index]}°
                      </Typography>
                      <Typography variant="body2" color="primary">
                        Current: {jointAngles?.[index]?.toFixed(1) || 0}°
                      </Typography>
                    </Box>
                  </Box>
                  
                  <Slider
                    value={targetAngles[index]}
                    onChange={(_, value) => handleJointChange(index, value)}
                    min={joint.min}
                    max={joint.max}
                    step={1}
                    marks={[
                      { value: joint.min, label: `${joint.min}°` },
                      { value: 0, label: '0°' },
                      { value: joint.max, label: `${joint.max}°` }
                    ]}
                    disabled={!connected || loading}
                    sx={{ mb: 1 }}
                  />
                </Box>
              ))}
            </CardContent>
          </Card>
        </Grid>

        {/* Control Settings */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Movement Settings
              </Typography>
              
              {/* Speed Control */}
              <Box sx={{ mb: 3 }}>
                <Typography variant="body2" gutterBottom>
                  Speed: {speed}%
                </Typography>
                <Slider
                  value={speed}
                  onChange={(_, value) => setSpeed(value)}
                  min={1}
                  max={100}
                  step={1}
                  disabled={!connected || loading}
                />
              </Box>

              {/* Movement Mode */}
              <Box sx={{ mb: 3 }}>
                <Typography variant="body2" gutterBottom>
                  Movement Mode
                </Typography>
                <FormControlLabel
                  control={
                    <Switch
                      checked={movementMode === 'coordinated'}
                      onChange={(e) => 
                        setMovementMode(e.target.checked ? 'coordinated' : 'individual')
                      }
                      disabled={!connected || loading}
                    />
                  }
                  label={movementMode === 'coordinated' ? 'Coordinated' : 'Individual'}
                />
              </Box>

              {/* Torque Enable */}
              <Box sx={{ mb: 3 }}>
                <FormControlLabel
                  control={
                    <Switch
                      checked={torqueEnabled}
                      onChange={(e) => setTorqueEnabled(e.target.checked)}
                      disabled={!connected || loading}
                    />
                  }
                  label="Torque Enabled"
                />
              </Box>
            </CardContent>
          </Card>
        </Grid>

        {/* Action Buttons */}
        <Grid item xs={12}>
          <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
            <Button
              variant="contained"
              startIcon={<PlayArrow />}
              onClick={executeMovement}
              disabled={!connected || loading}
              size="large"
            >
              {loading ? 'Moving...' : 'Execute Movement'}
            </Button>
            
            <Button
              variant="outlined"
              startIcon={<Home />}
              onClick={homePosition}
              disabled={!connected || loading}
            >
              Home Position
            </Button>
            
            <Button
              variant="contained"
              color="error"
              startIcon={<Stop />}
              onClick={stopMotion}
              disabled={!connected}
            >
              Emergency Stop
            </Button>
          </Box>
        </Grid>
      </Grid>
    </Paper>
  );
};

export default ControlPanel;
